import React, { Component } from 'react'
import { Row, Col, Icon } from 'antd'

export default class ChatTextarea extends Component {
    render() {
        return (
            <div className="chat-tools">
                <Row>
                    <Col span={18}>
                        <Icon type="smile" /> &nbsp;&nbsp;
                        <Icon type="folder" />
                    </Col>
                    <Col span={6}>
                    </Col>
                </Row>
            </div>
        )
    }
}
